    StrBuilder sb = new StrBuilder();
    sb.setNullText("NULL").append((StrBuilder) null);
    assertEquals("NULL", sb.toString());

    sb = new StrBuilder();
    sb.append(new StrBuilder("foo"));
    assertEquals("foo", sb.toString());

